import React, { useEffect, useState } from "react";

function App() {
  const [breakLength, setBreakLength] = useState("5");
  return (
    <div
      style={{ backgroundColor: "#1e555c", color: "white", height: "100vh" }}
    >
      <div
        style={{
          display: "flex",
          flexDirection: "column",
          justifyContent: "center",
          alignItems: "center",
          height: "100vh",
        }}
      >
        <h1>25 + 5 Clock</h1>
        <h2>Break Length</h2>
        <button>↑</button>
        <h2>{breakLength}</h2>
        <button>↓</button>
      </div>
    </div>
  );
}

export default App;
